// ==UserScript==
// @name         Quasty Password Security Toolkit
// @namespace    http://tampermonkey.net/
// @version      2.7
// @icon         data:image/png;base64,
// @description  Advanced password testing tool with wordlist analysis and password generation
// @author       AnonymousCH_X073
// @match        https://sso.ccw.site/web/auth/login-by-password
// @match        https://www.ccw.site/*
// @grant        GM_addStyle
// @grant        GM_setValue
// @grant        GM_getValue
// @grant        GM_download
// @icon         [Your icon data here]
// ==/UserScript==

(function() {
    'use strict';

    // 添加自定义样式
    GM_addStyle(`
        #passwordToolkit {
            position: fixed;
            bottom: 20px;
            right: 20px;
            width: 40px;
            height: 40px;
            background: #3498db;
            border-radius: 50%;
            box-shadow: 0 3px 10px rgba(0,0,0,0.2);
            z-index: 10000;
            cursor: pointer;
            display: flex;
            justify-content: center;
            align-items: center;
            color: white;
            font-weight: bold;
            font-size: 18px;
            transition: all 0.3s ease;
        }

        #passwordToolkit:hover {
            transform: scale(1.1);
            background: #2980b9;
        }

        #passwordToolkitWindow {
            position: fixed;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            width: 400px;
            background: #fff;
            border-radius: 10px;
            box-shadow: 0 10px 30px rgba(0,0,0,0.3);
            z-index: 10001;
            display: none;
            overflow: hidden;
            font-family: Arial, sans-serif;
        }

        .window-header {
            background: #2c3e50;
            color: white;
            padding: 12px 15px;
            display: flex;
            justify-content: space-between;
            align-items: center;
            cursor: move;
            user-select: none;
        }

        .window-title {
            font-weight: bold;
        }

        .window-controls {
            display: flex;
            gap: 10px;
        }

        .control-btn {
            width: 14px;
            height: 14px;
            border-radius: 50%;
            cursor: pointer;
        }

        .close-btn {
            background: #ff5f57;
        }

        .minimize-btn {
            background: #ffbd2e;
        }

        .maximize-btn {
            background: #28ca42;
        }

        .window-body {
            padding: 20px;
            max-height: 400px;
            overflow-y: auto;
        }

        .tab-container {
            display: flex;
            margin-bottom: 15px;
            border-bottom: 1px solid #ddd;
        }

        .tab {
            padding: 8px 15px;
            cursor: pointer;
            border-bottom: 3px solid transparent;
        }

        .tab.active {
            border-bottom: 3px solid #3498db;
            font-weight: bold;
        }

        .tab-content {
            display: none;
        }

        .tab-content.active {
            display: block;
        }

        .input-group {
            margin-bottom: 15px;
        }

        label {
            display: block;
            margin-bottom: 5px;
            font-weight: bold;
            color: #2c3e50;
        }

        input[type="text"], input[type="password"], select {
            width: 100%;
            padding: 10px;
            border: 1px solid #ddd;
            border-radius: 5px;
            font-size: 14px;
        }

        .btn {
            width: 100%;
            padding: 10px;
            background: #3498db;
            color: white;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            margin: 5px 0;
            font-weight: bold;
        }

        .btn:hover {
            background: #2980b9;
        }

        .btn-success {
            background: #27ae60;
        }

        .btn-success:hover {
            background: #219653;
        }

        .btn-secondary {
            background: #7f8c8d;
        }

        .btn-secondary:hover {
            background: #636e70;
        }

        .test-results {
            margin-top: 15px;
            padding: 10px;
            background: #f9f9f9;
            border-radius: 5px;
            font-size: 14px;
        }

        .warning {
            color: #e74c3c;
            font-weight: bold;
            margin: 10px 0;
        }

        .password-strength {
            height: 10px;
            background: #eee;
            border-radius: 5px;
            margin: 10px 0;
            overflow: hidden;
        }

        .strength-meter {
            height: 100%;
            width: 0%;
            transition: width 0.5s;
        }

        .option-group {
            display: flex;
            align-items: center;
            margin: 5px 0;
        }

        .option-group label {
            margin: 0 0 0 10px;
            font-weight: normal;
        }

        .password-list {
            max-height: 150px;
            overflow-y: auto;
            border: 1px solid #ddd;
            border-radius: 5px;
            padding: 5px;
            margin: 10px 0;
        }

        .password-item {
            padding: 5px;
            border-bottom: 1px solid #eee;
            font-family: monospace;
        }

        .password-item:last-child {
            border-bottom: none;
        }

        #passwordToolkitWindow.minimized {
            width: 300px;
            height: auto;
        }

        #passwordToolkitWindow.minimized .window-body {
            display: none;
        }

        #passwordToolkitWindow.maximized {
            width: 90%;
            height: 90%;
            top: 5%;
            left: 5%;
            transform: none;
        }

        #passwordToolkitWindow.maximized .window-body {
            max-height: calc(100% - 45px);
        }
    `);

    // 创建启动按钮
    function createLauncher() {
        const launcher = document.createElement('div');
        launcher.id = 'passwordToolkit';
        launcher.innerHTML = 'Q';
        launcher.title = 'Password Toolkit';

        // 添加拖动功能
        let isDragging = false;
        let dragOffsetX, dragOffsetY;

        launcher.addEventListener('mousedown', function(e) {
            isDragging = true;
            dragOffsetX = e.clientX - launcher.offsetLeft;
            dragOffsetY = e.clientY - launcher.offsetTop;
            launcher.style.cursor = 'grabbing';
        });

        document.addEventListener('mousemove', function(e) {
            if (isDragging) {
                launcher.style.left = (e.clientX - dragOffsetX) + 'px';
                launcher.style.top = (e.clientY - dragOffsetY) + 'px';
                launcher.style.right = 'auto';
                launcher.style.bottom = 'auto';
            }
        });

        document.addEventListener('mouseup', function() {
            isDragging = false;
            launcher.style.cursor = 'pointer';
        });

        launcher.addEventListener('click', function() {
            if (window.passwordToolkitVisible) {
                hidePasswordToolkit();
            } else {
                showPasswordToolkit();
            }
        });

        document.body.appendChild(launcher);
    }

    // 创建主窗口
    function createMainWindow() {
        const window = document.createElement('div');
        window.id = 'passwordToolkitWindow';

        window.innerHTML = `
            <div class="window-header">
                <div class="window-title">Quasty Password Security Toolkit</div>
                <div class="window-controls">
                    <div class="control-btn minimize-btn" title="Minimize"></div>
                    <div class="control-btn maximize-btn" title="Maximize"></div>
                    <div class="control-btn close-btn" title="Close"></div>
                </div>
            </div>
            <div class="window-body">
                <div class="tab-container">
                    <div class="tab active" data-tab="strength">Password Test</div>
                    <div class="tab" data-tab="generate">Password Generator</div>
                    <div class="tab" data-tab="wordlist">Wordlist Analysis</div>
                </div>

                <div class="tab-content active" id="strength-tab">
                    <div class="input-group">
                        <label for="testPassword">Password to test:</label>
                        <input type="password" id="testPassword" placeholder="Enter password to test">
                    </div>
                    <div class="password-strength">
                        <div class="strength-meter" id="strengthMeter"></div>
                    </div>
                    <button class="btn" id="testStrengthBtn">Test Password Strength</button>
                    <button class="btn btn-secondary" id="commonPasswordsBtn">Check Common Passwords</button>
                    <div class="test-results" id="testResults"></div>
                </div>

                <div class="tab-content" id="generate-tab">
                    <div class="input-group">
                        <label for="pwdLength">Password Length:</label>
                        <input type="number" id="pwdLength" min="8" max="32" value="12">
                    </div>

                    <div class="option-group">
                        <input type="checkbox" id="useUppercase" checked>
                        <label for="useUppercase">Uppercase Letters (A-Z)</label>
                    </div>

                    <div class="option-group">
                        <input type="checkbox" id="useLowercase" checked>
                        <label for="useLowercase">Lowercase Letters (a-z)</label>
                    </div>

                    <div class="option-group">
                        <input type="checkbox" id="useNumbers" checked>
                        <label for="useNumbers">Numbers (0-9)</label>
                    </div>

                    <div class="option-group">
                        <input type="checkbox" id="useSymbols" checked>
                        <label for="useSymbols">Symbols (!@#$%^&*)</label>
                    </div>

                    <button class="btn btn-success" id="generatePasswordBtn">Generate Password</button>
                    <div class="input-group">
                        <input type="text" id="generatedPassword" readonly>
                    </div>
                    <button class="btn" id="copyPasswordBtn">Copy Password</button>
                    <div class="test-results" id="generateResults"></div>
                </div>

                <div class="tab-content" id="wordlist-tab">
                    <div class="input-group">
                        <label for="wordlistFile">Select Wordlist File:</label>
                        <input type="file" id="wordlistFile" accept=".txt">
                    </div>
                    <button class="btn" id="analyzeWordlistBtn">Analyze Wordlist</button>
                    <div class="test-results" id="wordlistResults"></div>
                    <div class="password-list" id="passwordExamples"></div>
                </div>
            </div>
        `;

        document.body.appendChild(window);

        // 添加窗口控制功能
        const closeBtn = window.querySelector('.close-btn');
        const minimizeBtn = window.querySelector('.minimize-btn');
        const maximizeBtn = window.querySelector('.maximize-btn');
        const header = window.querySelector('.window-header');

        closeBtn.addEventListener('click', hidePasswordToolkit);

        minimizeBtn.addEventListener('click', function() {
            window.classList.toggle('minimized');
        });

        maximizeBtn.addEventListener('click', function() {
            window.classList.toggle('maximized');
        });

        // 添加标签切换功能
        const tabs = window.querySelectorAll('.tab');
        tabs.forEach(tab => {
            tab.addEventListener('click', function() {
                tabs.forEach(t => t.classList.remove('active'));
                this.classList.add('active');

                const tabName = this.getAttribute('data-tab');
                window.querySelectorAll('.tab-content').forEach(content => {
                    content.classList.remove('active');
                });

                window.querySelector(`#${tabName}-tab`).classList.add('active');
            });
        });

        // 添加事件监听器
        document.getElementById('testStrengthBtn').addEventListener('click', testPasswordStrength);
        document.getElementById('commonPasswordsBtn').addEventListener('click', checkCommonPasswords);
        document.getElementById('testPassword').addEventListener('input', updateStrengthMeter);
        document.getElementById('generatePasswordBtn').addEventListener('click', generatePassword);
        document.getElementById('copyPasswordBtn').addEventListener('click', copyPassword);
        document.getElementById('analyzeWordlistBtn').addEventListener('click', analyzeWordlist);

        // 添加窗口拖拽功能
        let isWindowDragging = false;
        let windowDragOffsetX, windowDragOffsetY;

        header.addEventListener('mousedown', function(e) {
            isWindowDragging = true;
            windowDragOffsetX = e.clientX - window.offsetLeft;
            windowDragOffsetY = e.clientY - window.offsetTop;
            window.style.cursor = 'grabbing';
        });

        document.addEventListener('mousemove', function(e) {
            if (isWindowDragging) {
                window.style.left = (e.clientX - windowDragOffsetX) + 'px';
                window.style.top = (e.clientY - windowDragOffsetY) + 'px';
                window.style.transform = 'none';
            }
        });

        document.addEventListener('mouseup', function() {
            isWindowDragging = false;
            window.style.cursor = 'default';
        });
    }

    // 显示密码工具窗口
    function showPasswordToolkit() {
        const window = document.getElementById('passwordToolkitWindow');
        window.style.display = 'block';
        window.passwordToolkitVisible = true;
    }

    // 隐藏密码工具窗口
    function hidePasswordToolkit() {
        const window = document.getElementById('passwordToolkitWindow');
        window.style.display = 'none';
        window.passwordToolkitVisible = false;
    }

    // 更新密码强度指示器
    function updateStrengthMeter() {
        const password = document.getElementById('testPassword').value;
        const strengthMeter = document.getElementById('strengthMeter');
        const strength = calculatePasswordStrength(password);

        strengthMeter.style.width = strength + '%';

        if (strength < 30) {
            strengthMeter.style.background = '#e74c3c';
        } else if (strength < 70) {
            strengthMeter.style.background = '#f39c12';
        } else {
            strengthMeter.style.background = '#2ecc71';
        }
    }

    // 计算密码强度
    function calculatePasswordStrength(password) {
        let strength = 0;

        if (password.length > 0) strength += 10;
        if (password.length > 6) strength += 15;
        if (password.length > 10) strength += 15;
        if (/[A-Z]/.test(password)) strength += 15;
        if (/[0-9]/.test(password)) strength += 15;
        if (/[^A-Za-z0-9]/.test(password)) strength += 15;
        if (password.length > 14) strength += 15;

        return Math.min(strength, 100);
    }

    // 测试密码强度
    function testPasswordStrength() {
        const password = document.getElementById('testPassword').value;
        const strength = calculatePasswordStrength(password);
        const results = document.getElementById('testResults');

        let message = '';
        if (strength < 30) {
            message = 'Password Strength: Very Weak - Easily Crackable';
        } else if (strength < 50) {
            message = 'Password Strength: Weak - Consider Stronger Password';
        } else if (strength < 70) {
            message = 'Password Strength: Medium - Could Be Improved';
        } else if (strength < 90) {
            message = 'Password Strength: Strong - Good Security';
        } else {
            message = 'Password Strength: Very Strong - Excellent Security';
        }

        results.innerHTML = `<strong>Test Results:</strong> ${message}<br>`;
        results.innerHTML += `<strong>Length:</strong> ${password.length} characters<br>`;

        if (password.length < 8) {
            results.innerHTML += '<span class="warning">Warning: Password should be at least 8 characters long</span><br>';
        }

        if (!/[A-Z]/.test(password)) {
            results.innerHTML += '<span class="warning">Suggestion: Add uppercase letters to increase security</span><br>';
        }

        if (!/[0-9]/.test(password)) {
            results.innerHTML += '<span class="warning">Suggestion: Add numbers to increase security</span><br>';
        }

        if (!/[^A-Za-z0-9]/.test(password)) {
            results.innerHTML += '<span class="warning">Suggestion: Add special characters to increase security</span><br>';
        }
    }

    // 检查常见密码
    function checkCommonPasswords() {
        const password = document.getElementById('testPassword').value;
        const results = document.getElementById('testResults');

        // 常见密码列表
        const commonPasswords = [
            'password', '123456', '12345678', '1234', 'qwerty', '12345',
            'dragon', 'baseball', 'football', 'letmein', 'monkey', 'abc123',
            'admin', 'welcome', 'password1', '123123', 'sunshine', 'login',
            'passw0rd', 'master', 'hello', 'freedom', 'whatever', 'qazwsx'
        ];

        if (commonPasswords.includes(password.toLowerCase())) {
            results.innerHTML = `<span class="warning">Warning: This password is very common and easily crackable!</span>`;
        } else {
            results.innerHTML = `This password is not in the most common passwords list. Good security.`;
        }
    }

    // 生成密码
    function generatePassword() {
        const length = parseInt(document.getElementById('pwdLength').value) || 12;
        const useUppercase = document.getElementById('useUppercase').checked;
        const useLowercase = document.getElementById('useLowercase').checked;
        const useNumbers = document.getElementById('useNumbers').checked;
        const useSymbols = document.getElementById('useSymbols').checked;

        const uppercase = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ';
        const lowercase = 'abcdefghijklmnopqrstuvwxyz';
        const numbers = '0123456789';
        const symbols = '!@#$%^&*()_+-=[]{}|;:,.<>?';

        let characters = '';
        if (useUppercase) characters += uppercase;
        if (useLowercase) characters += lowercase;
        if (useNumbers) characters += numbers;
        if (useSymbols) characters += symbols;

        if (characters.length === 0) {
            document.getElementById('generateResults').innerHTML = '<span class="warning">Please select at least one character type</span>';
            return;
        }

        let password = '';
        for (let i = 0; i < length; i++) {
            const randomIndex = Math.floor(Math.random() * characters.length);
            password += characters[randomIndex];
        }

        document.getElementById('generatedPassword').value = password;
        document.getElementById('generateResults').innerHTML = 'Password generated successfully';

        // 自动测试生成的密码强度
        document.getElementById('testPassword').value = password;
        updateStrengthMeter();
        testPasswordStrength();
    }

    // 复制密码
    function copyPassword() {
        const passwordField = document.getElementById('generatedPassword');
        passwordField.select();
        document.execCommand('copy');
        document.getElementById('generateResults').innerHTML = 'Password copied to clipboard';
    }

    // 分析密码包
    function analyzeWordlist() {
        const fileInput = document.getElementById('wordlistFile');
        const results = document.getElementById('wordlistResults');
        const examples = document.getElementById('passwordExamples');

        if (!fileInput.files.length) {
            results.innerHTML = '<span class="warning">Please select a wordlist file first</span>';
            return;
        }

        const file = fileInput.files[0];
        const reader = new FileReader();

        reader.onload = function(e) {
            const content = e.target.result;
            const passwords = content.split('\n').filter(p => p.trim().length > 0);

            if (passwords.length === 0) {
                results.innerHTML = '<span class="warning">No valid passwords found in the wordlist</span>';
                return;
            }

            // 分析密码包
            let totalLength = 0;
            let hasUppercase = 0;
            let hasLowercase = 0;
            let hasNumbers = 0;
            let hasSymbols = 0;
            let commonCount = 0;

            // 常见密码列表
            const commonPasswords = [
                'password', '123456', '12345678', '1234', 'qwerty', '12345',
                'dragon', 'baseball', 'football', 'letmein', 'monkey', 'abc123',
                'admin', 'welcome', 'password1', '123123', 'sunshine', 'login',
                'passw0rd', 'master', 'hello', 'freedom', 'whatever', 'qazwsx'
            ];

            passwords.forEach(pwd => {
                totalLength += pwd.length;
                if (/[A-Z]/.test(pwd)) hasUppercase++;
                if (/[a-z]/.test(pwd)) hasLowercase++;
                if (/[0-9]/.test(pwd)) hasNumbers++;
                if (/[^A-Za-z0-9]/.test(pwd)) hasSymbols++;
                if (commonPasswords.includes(pwd.toLowerCase())) commonCount++;
            });

            // 显示分析结果
            results.innerHTML = `
                <strong>Wordlist Analysis Results:</strong><br>
                - Total Passwords: ${passwords.length}<br>
                - Average Length: ${(totalLength / passwords.length).toFixed(2)} characters<br>
                - Contains Uppercase: ${hasUppercase} (${((hasUppercase / passwords.length) * 100).toFixed(2)}%)<br>
                - Contains Lowercase: ${hasLowercase} (${((hasLowercase / passwords.length) * 100).toFixed(2)}%)<br>
                - Contains Numbers: ${hasNumbers} (${((hasNumbers / passwords.length) * 100).toFixed(2)}%)<br>
                - Contains Symbols: ${hasSymbols} (${((hasSymbols / passwords.length) * 100).toFixed(2)}%)<br>
                - Common Weak Passwords: ${commonCount} (${((commonCount / passwords.length) * 100).toFixed(2)}%)<br>
            `;

            // 显示密码示例
            examples.innerHTML = '';
            const samplePasswords = passwords.slice(0, Math.min(10, passwords.length));
            samplePasswords.forEach(pwd => {
                const div = document.createElement('div');
                div.className = 'password-item';
                div.textContent = pwd;
                examples.appendChild(div);
            });
        };

        reader.readAsText(file);
    }

    // 初始化
    function init() {
        createLauncher();
        createMainWindow();
        window.passwordToolkitVisible = false;
    }

    // 页面加载完成后初始化
    if (document.readyState === 'loading') {
        document.addEventListener('DOMContentLoaded', init);
    } else {
        init();
    }
})();